import React from "react";
import { Navigate, Route } from "react-router-dom";

const ProtectedRoute = ({ element: Component, ...props }) => {
    return (
    <Route> 
     { props.loggedIn ? <Component {...props} /> : <Navigate to="/sign-in" replace /> }
    </Route>
    )
}

export default ProtectedRoute;
